// import Link from 'next/link'
import Layout from "../components/Layout";
import { withRouter } from "next/router";
import React from "react";
import "@/static/css/font-awesome.css";
import "./css/index.css";
import fetch from "isomorphic-unfetch";
import { fetchpost, fetchget } from "../utils/zgfetch";
// import Fromdemo from "./components/from"


export default class Login extends React.Component{

    constructor(props:any) {
        super(props);
        this.state = {
            userName: '',//用户名
            passWord: '',//密码
            userNameValid: true,
            passWordValid: true,
        }
    }

    getUser = async function () {
        const city = await fetchget("http://localhost:3001/users")
        console.log(city)
    }


  render() {
    return (
      <Layout title="登录页">
        <div className="container clear">
          <div className="tbl">
            <div></div>
          </div>
          <div className="ph clear">
            {/* <%--显示手机图--%> */}
            {/* <div className="o"></div> */}
          </div>
          <div className="m clear">
            <div>密码登录</div>
            <div>
              <form className="loginBox" action="/home" method="post">
                <input type="text" name="userName" placeholder="请输入用户名" />
                <br></br>
                <input
                  type="password"
                  name="password"
                  placeholder="请输入密码"
                />
                <br></br>
                <input type="button" value="登录豆瓣读书"  onClick={this.getUser}/>
              </form>
              {/* <Fromdemo></Fromdemo> */}
              {/* <div></div> */}
            </div>
            {/* <%--二维码标识--%> */}
            <div></div>
            <div className="tx clear">---换一种登录方式---</div>
            <div className="wx"></div>
            <div className="xl clear"></div>
          </div>
          <div className="sew">
            <div></div>
            <div>登录孔子旧书APP</div>
          </div>
        </div>
      </Layout>
    );
  }
}
